clear screen
@clean
set termout off
conn USERNAME/PASSWORD@DATABASE_SERVICE
set termout off
drop table cust_trans3 purge;
drop table cities purge;
drop table countries purge;
set termout on
set echo on
clear screen
create table countries (
  country_name varchar2(100),
  country_code varchar2(5) primary key,
  iso3 varchar2(5) unique );
pause
create table cities (
  city_name varchar2(100),
  ascii_name varchar2(100),
  country_code varchar2(5) references countries ( country_code),
  latitude number,
  longtitude number,
  population number,
  constraint cities_pk primary key (city_name,latitude,longtitude) );
pause
set echo off
clear screen
pro 
pro Populating tables
pro
set termout off
alter session set cursor_sharing = force;
set feedback off

commit;


commit;

alter session set cursor_sharing = exact;
set feedback on

exec dbms_stats.gather_table_stats('','cities')
exec dbms_stats.gather_table_stats('','countries')
set termout on
set echo on

select table_name, num_rows
from   user_tables
where  table_name in ('CITIES','COUNTRIES');
pause
col country_name format a30
col city_name format a30
clear screen

select ascii_name city_name, latitude, longtitude from cities where rownum <= 10;
pause
select * from countries where rownum <= 10;
pause
clear screen
select c2.country_code,
       count(*) number_of_cities
from   cities    c1,
       countries c2
where  c2.country_code = c1.country_code
group  by c2.country_code
fetch first 10 rows only;
pause
clear screen
select c2.country_code,
       c2.country_name,
       count(*) number_of_cities
from   cities    c1,
       countries c2
where  c2.country_code = c1.country_code
group  by c2.country_code,
          c2.country_name
fetch first 10 rows only;
pause
clear screen
          
select c2.country_code,
       min(c2.country_name) country_name,
       count(*) number_of_cities
from   cities    c1,
       countries c2
where  c2.country_code = c1.country_code
group  by c2.country_code
fetch first 10 rows only;
pause
clear screen


select c2.country_code,
       any_value(c2.country_name) country_name,
       count(*) number_of_cities
from   cities    c1,
       countries c2
where  c2.country_code = c1.country_code
group  by c2.country_code
fetch first 10 rows only;
pause
clear screen

select c2.country_code,
       c2.country_name,
       c1.number_of_cities
from   (select country_code,
               count(*) number_of_cities
        from   cities
        group  by country_code) c1,
       countries c2
where  c2.country_code = c1.country_code
fetch first 10 rows only;
pause
