create table cust_trans3 
( cust_id      int, 
  cust_name    varchar2(20), 
  cust_Details clob, 
  country      varchar2(10), 
  amt number )
;
pause

insert /*+ APPEND */ into cust_trans3
select 
  mod(rownum,100) cust_id, 
  'cust'||mod(rownum,100) cust_name,
  rpad(mod(rownum,100),10000,'x') cust_Details,
  'ctry'||mod(rownum,100) country,
  rownum amt
from 
 ( select 1 from dual connect by level <= 100 );
commit;
pause
clear screen

select cust_id, any_value(cust_Details), max(amt)
from cust_trans3
group by cust_id;

